import React from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer, PieChart, Pie, Cell } from 'recharts';
import './AdminPage.css';

const AdminPage = ({ user }) => {
  const [activeTab, setActiveTab] = React.useState('classes');

  const classData = [
    { name: '转 壮', understanding: 85, responses: 24 },
    { name: '转 壮', understanding: 92, responses: 28 },
    { name: '转 壮', understanding: 78, responses: 22 },
  ];

  const teacherData = [
    { name: '专', understanding: 88, responses: 35 },
    { name: '砖专', understanding: 82, responses: 32 },
    { name: '专', understanding: 90, responses: 38 },
  ];

  const subjectData = [
    { name: '转拽', value: 35 },
    { name: '注专转', value: 25 },
    { name: '转', value: 20 },
    { name: '注', value: 20 },
  ];

  const COLORS = ['#667eea', '#764ba2', '#f093fb', '#4facfe'];

  return (
    <div className="admin-page">
      <header className="admin-header">
        <h1>  </h1>
        <p>专 专转, 转</p>
      </header>

      <div className="admin-tabs">
        <button
          className={activeTab === 'classes' ? 'active' : ''}
          onClick={() => setActiveTab('classes')}
        >
          驻 转转
        </button>
        <button
          className={activeTab === 'teachers' ? 'active' : ''}
          onClick={() => setActiveTab('teachers')}
        >
          驻 专转
        </button>
        <button
          className={activeTab === 'subjects' ? 'active' : ''}
          onClick={() => setActiveTab('subjects')}
        >
          驻 拽爪注转
        </button>
      </div>

      <div className="admin-content">
        {activeTab === 'classes' && (
          <div className="chart-container">
            <h2> 驻 转</h2>
            <ResponsiveContainer width="100%" height={300}>
              <BarChart data={classData}>
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Bar dataKey="understanding" fill="#667eea" name=" " />
              </BarChart>
            </ResponsiveContainer>
          </div>
        )}

        {activeTab === 'teachers' && (
          <div className="chart-container">
            <h2>爪注 驻 专</h2>
            <ResponsiveContainer width="100%" height={300}>
              <BarChart data={teacherData}>
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Bar dataKey="understanding" fill="#764ba2" name=" " />
              </BarChart>
            </ResponsiveContainer>
          </div>
        )}

        {activeTab === 'subjects' && (
          <div className="chart-container">
            <h2>转驻转 驻 拽爪注</h2>
            <ResponsiveContainer width="100%" height={300}>
              <PieChart>
                <Pie
                  data={subjectData}
                  cx="50%"
                  cy="50%"
                  labelLine={false}
                  label={({ name, value }) => `${name}: ${value}%`}
                  outerRadius={80}
                  fill="#8884d8"
                  dataKey="value"
                >
                  {subjectData.map((entry, index) => (
                    <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                  ))}
                </Pie>
                <Tooltip />
              </PieChart>
            </ResponsiveContainer>
          </div>
        )}
      </div>

      <div className="insights">
        <h2> 转转</h2>
        <div className="insight-card">
          <p><strong>拽转 拽:</strong> 专 砖专 注 志92%  转 壮</p>
        </div>
        <div className="insight-card">
          <p><strong>砖 砖驻专:</strong> 转 壮 住专 爪专 拽 住祝</p>
        </div>
      </div>
    </div>
  );
};

export default AdminPage;
